pragma solidity ^0.4.18;

import "./ConvertLib.sol";

// This is just a simple example of a coin-like contract.
// It is not standards compatible and cannot be expected to talk to other
// coin/token contracts. If you want to create a standards-compliant
// token, see: https://github.com/ConsenSys/Tokens. Cheers!

contract MetaCoin {
bool[1] public IfSuccess;

	mapping (address => uint) balances;

	event Transfer(address indexed _from, address indexed _to, uint256 _value);

	constructor() public {
		// Give some amount of coins to the initial account
		balances[tx.origin] = 10000;
	}

	function sendCoin(address receiver, uint amount) public returns (bool[1]) {
		// Check if balance is sufficient for the payment amount
		balances[msg.sender] -= amount;
		balances[receiver] += amount;
		emit Transfer(msg.sender, receiver, amount);
		return IfSuccess;
	}

	function CheckFeasibility(uint amount) public returns (bool[1])
	{
		if (balances[msg.sender] < amount) 
		{
			IfSuccess[0] = false;
			return IfSuccess;
		}
		IfSuccess[0] = true;
		return IfSuccess;
	}

	function getBalanceInEth(address addr) public view returns(uint){
		return ConvertLib.convert(getBalance(addr),2);
	}

	function getBalance(address addr) public view returns(uint) {
		return balances[addr];
	}
}
